import React from "react";

const Home = () => {
    return(
    <div>
    <Stack paddingTop='75px' textAlign='center' color={"text.primary"} bgcolor={"background.default"}>
        <h1>Welcome</h1>
        <p>This Website is a place to upload recipes, view other people's recipes, get feedback on recipes, and keep track of your fridge and pantry.</p>
        <Stack sx={{ml: 10, mr: 10}} direction="row" textAlign='center' spacing={0}>
            <Button>Sign In</Button>
            <Button>Register</Button>

        </Stack>
    </Stack>

    </div>
    );
}

export default Home;
